using InventorySystem.Shared.Entities.Core;
using InventorySystem.Shared.Entities.Enumerations.SeedEnumeration;
using Newtonsoft.Json;

namespace InventorySystem.Shared.Tools
{
    public static class DemoDataUtility
    {
        public readonly static string Image1 = "";
        public readonly static string Image2 = "";
        public readonly static string Image3 = "";
        public readonly static string pdf1 = "";

        public readonly static string[] Priority = ["Low", "Medium", "High"];
        public readonly static string[] Images = [Image1, Image2, Image3];

        public static int GetRandomId()
        {
            Random random = new();
            return random.Next(1, 10);
        }

        public static int GetRandomNumber()
        {
            Random random = new();
            return random.Next(1, 1000);
        }

        public static string GetRandomImage()
        {
            Random random = new();
            int imageIndex = random.Next(0, 2);
            return Images[imageIndex];
        }

        public static string GetRandomPriority()
        {
            Random random = new();
            int imageIndex = random.Next(0, 2);
            return Priority[imageIndex];
        }

        public static string GetRandomDoc()
        {
            return pdf1;
        }

        public static string GetRandomSerial()
        {
            return Utility.GenerateRandomPassword(10, false, false, true, false);
        }

        public static string GetRandomPhone()
        {
            Random random = new();
            return random.Next(10000000, 99999999) + "";
        }

        public static double GetRandomLatitude()
        {
            Random random = new();
            double minLatitude = 24.47;
            double maxLatitude = 26.15;
            double randomLatitude = random.NextDouble() * (maxLatitude - minLatitude) + minLatitude;
            return Math.Round(randomLatitude, 6); // Round to 6 decimal places
        }

        public static double GetRandomLongitude()
        {
            Random random = new();
            double minLongitude = 50.75;
            double maxLongitude = 51.65;
            double randomLongitude = random.NextDouble() * (maxLongitude - minLongitude) + minLongitude;
            return Math.Round(randomLongitude, 6); // Round to 6 decimal places
        }

        public static string GetRandomCordinateArray()
        {
            List<string> list = [];
            for (int i = 0; i <= 1; i++)
            {
                list.Add($"{GetRandomLatitude().ToString()},{GetRandomLongitude().ToString()}");
            }
            var xx = JsonConvert.SerializeObject(list);
            return xx;
        }

        public static Currency GetRandomCurrency()
        {
            List<Currency> allCurruncies = CurrencyEnum.GetAll();
            int randomIndex = new Random().Next(allCurruncies.Count);

            return allCurruncies[randomIndex];
        }

    }
}
